const Main = () => {
    return (
        <section className="hero-container">
            <div className='hero-card'>
                <img src={pp}></img>
                <label className='card-text'>
                    <h2 id='my-name'>Juan J Gomez</h2>
                    <h4>Incoming Software Engineer</h4>
                </label>
            </div>
        </section>
    );
}
export default Main;
